import React, {Component} from 'react';

class Photo extends Component {
    render(){
      return(
        <div>
          <figure>
            <img src = {this.props.post.imageLink} alt = {this.props.post.description}></img>
          </figure>
          <figcaption>
            <h4>{this.props.post.description}</h4>
          </figcaption>
        </div>
      );
    }
  }

export default Photo;
